    [],nt"num_tags": 0,nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-surfa533e",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0117672 includes Surface
    underway, chemical, meteorological and physical data collected from SOYO-MARU in
    the North Pacific Ocean, Philippine Sea and Sea of Japan from 2010-11-12 to 2011-07-17
    and retrieved during cruise SY101112, SY110521 and SY110712. These data include
    BAROMETRIC PRESSURE, Partial pressure (or fugacity) of carbon dioxide - water, SALINITY
    and SEA SURFACE TEMPERATURE. The instruments used to collect these data include
    Carbon dioxide (CO2) gas analyzer and Micro-porous membrane equilibrator for discrete
    carbon dioxide measurement. These data were collected by Tsuneo Ono and Tadafumi
    Ichikawa of National Research Institute of Fisheries Science as part of the VOS_Soyo_Maru_2011
    data set.nnThe Global Volunteer Observing Ship (VOS) Program is coordinated by the
    UNESCO International Ocean Carbon Coordination Project (IOCCP). International groups
    from 14 countries have been outfitting research ships and commercial vessels with
    automated CO2 sampling equipment to analyze the carbon exchange between the ocean
    and atmosphere.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
